            bool doMasks,
            Func<TES4_ErrorMask> errorMask)
        {
            var finalPosition = HeaderTranslation.ParseRecord(
                reader,
                TES4_Registration.TES4_HEADER);
            return Create_Binary_Internal(
                reader: reader,
                doMasks: doMasks,
                finalPosition: finalPosition,
                errorMask: errorMask);
        }

        private static TES4 Create_Binary_Internal(
            BinaryReader reader,
            bool doMasks,
            long finalPosition,
            Func<TES4_ErrorMask> errorMask)
        {
            var ret = new TES4();
            try
            {
                Fill_Binary(
                    item: ret,
                    reader: reader,
                    doMasks: doMasks,
                    errorMask: errorMask);
                while (reader.BaseStream.Position < finalPosition)
                {
                    Fill_Binary_RecordTypes(
                        item: ret,
                        reader: reader,
                        doMasks: doMasks,
                        errorMask: errorMask);
                }
                if (reader.BaseStream.Position != finalPosition)
                {
                    reader.BaseStream.Position = finalPosition;
                    throw new ArgumentException("Read more bytes than allocated");
                }
            }
            catch (Exception ex)
            when (doMasks)
            {
                errorMask().Overall = ex;
            }
            return ret;
        }

        protected static void Fill_Binary(
            TES4 item,
            BinaryReader reader,
            bool doMasks,
            Func<TES4_ErrorMask> errorMask)
        {
            {
                Exception subMask;
                var tryGet = Mutagen.Binary.ByteArrayBinaryTranslation.Instance.Parse(
                    reader,
                    doMasks: doMasks,
                    errorMask: out subMask,
                    length: 12);
                item._Fluff.SetIfSucceeded(tryGet);
                if (doMasks && subMask != null)
                {
                    errorMask().Fluff = subMask;
                }
            }
        }

        protected static void Fill_Binary_RecordTypes(
            TES4 item,
            BinaryReader reader,
            bool doMasks,
            Func<TES4_ErrorMask> errorMask)
        {
            var nextRecordType = HeaderTranslation.ReadNextSubRecordType(
                reader: reader,
                contentLength: out var subLength);
            switch (nextRecordType.Type)
            {
                case "HEDR":
                {
                    MaskItem<Exception, Header_ErrorMask> subMask;
                    reader.BaseStream.Position -= Constants.SUBRECORD_LENGTH;
                    var tryGet = LoquiBinaryTranslation<Header, Header_ErrorMask>.Instance.Parse(
                        reader: reader,
                        doMasks: doMasks,
                        mask: out subMask);
                    item._Header.SetIfSucceeded(tryGet);
                    if (doMasks && subMask != null)
                    {
                        errorMask().Header = subMask;
                    }
                }
                break;
                case "OFST":
                {
                    Exception subMask;
                    var tryGet = Mutagen.Binary.ByteArrayBinaryTranslation.Instance.Parse(
                        reader,
                        doMasks: doMasks,
                        errorMask: out subMask,
                        length: subLength);
                    item._TypeOffsets.SetIfSucceeded(tryGet);
                    if (doMasks && subMask != null)
                    {
                        errorMask().TypeOffsets = subMask;
                    }
                }
                break;
                case "DELE":
                {
                    Exception subMask;
                    var tryGet = Mutagen.Binary.ByteArrayBinaryTranslation.Instance.Parse(
                        reader,
                        doMasks: doMasks,
                        errorMask: out subMask,
                        length: subLength);
                    item._Deleted.SetIfSucceeded(tryGet);
                    if (doMasks && subMask != null)
                    {
                        errorMask().Deleted = subMask;
                    }
                }
                break;
                case "CNAM":
                {
                    Exception subMask;
                    var tryGet = Mutagen.Binary.StringBinaryTranslation.Instance.Parse(
                        reader,
                        doMasks: doMasks,
                        errorMask: out subMask,
                        length: subLength);
                    item._Author.SetIfSucceeded(tryGet);
                    if (doMasks && subMask != null)
                    {
                        errorMask().Author = subMask;
                    }
                }
                break;
                case "SNAM":
                {
                    Exception subMask;
                    var tryGet = Mutagen.Binary.StringBinaryTranslation.Instance.Parse(
                        reader,
                        doMasks: doMasks,
                        errorMask: out subMask,
                        length: subLength);
                    item._Description.SetIfSucceeded(tryGet);
                    if (doMasks && subMask != null)
                    {
                        errorMask().Description = subMask;
                    }
                }
                break;
                case "MAST":
                {
                    MaskItem<Exception, IEnumerable<MaskItem<Exception, MasterReference_ErrorMask>>> subMask;
                    var listTryGet = Mutagen.Binary.ListBinaryTranslation<MasterReference, MaskItem<Exception, MasterReference_ErrorMask>>.Instance.ParseRepeatedItem(
                        reader: reader,
                        triggeringRecord: TES4_Registration.MAST_HEADER,
                        doMasks: doMasks,
                        maskObj: out subMask,
                        transl: (BinaryReader r, bool listDoMasks, out MaskItem<Exception, MasterReference_ErrorMask> listSubMask) =>
                        {
                            r.BaseStream.Position -= Constants.SUBRECORD_LENGTH;
                            return LoquiBinaryTranslation<MasterReference, MasterReference_ErrorMask>.Instance.Parse(
                                reader: r,
                                doMasks: listDoMasks,
                                mask: out listSubMask);
                        }
                        );
                    item._MasterReferences.SetIfSucceeded(listTryGet);
                    if (doMasks && subMask != null)
                    {
                        errorMask().MasterReferences = subMask;
                    }
                }
                break;
                default:
                    reader.BaseStream.Position -= Constants.RECORD_LENGTH;
                    throw new ArgumentException($"Unexpected header {nextRecordType.Type} at position {reader.BaseStream.Position}");
            }
        }

